import React, { Fragment } from "react";
import classes from "./Header.module.css";
import imgLink from "../../assets.meals.jpg";

const Header = (props) => {
  return (
    <Fragment>
      <Header className={classes.header}>
        <h2>React Meals</h2>
        <button>Cart</button>
      </Header>
      <div className={classes["main-image"]}>
        <img src={imgLink}></img>
      </div>
    </Fragment>
  );
};

export default Header;
